import React from "react";
import logo from "../../assets/logo.png";
import { Container, Form } from "./styles";

const Main = () => (
  <Container>
    <img src={logo} alt="Github Compare" />

    <Form>
      <input type="text" placeholder="usuário/repositório" />
      <button type="submit">Ok</button>
    </Form>
  </Container>
);

export default Main;
